import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";



export default function Marchant() {
  function Users() {
    const [data, setData] = useState([]);
    useEffect(() => {
      axios
        .get("https://stekpayout.onrender.com/merchants")
        .then((res) => {
          console.log();
          setData();
        })
        .catch((err) => {
          alert("Something went wrong. ");
        });
    }, []);

  }
  return (
    <div>
      <div>
TABLE OF USERS :
<table>
<tr>
<th> ID </th>
<th> EMAIL </th>
<th> FIRST NAME</th>
<th> LAST NAME</th>
</tr>
{
data.length > 0 &&
data.map((item) => {
return (
<span> {item.email}, </span>
) 
})
}
</table>
</div>
    </div>
  ); 
}
